        static public string MinWindowV3(string s, string t)
        {
            if (String.IsNullOrEmpty(t)) return String.Empty;

            // My implementation after looking at the explanation by NeetCode
            // https://www.youtube.com/watch?v=jSto0O4AJbM

            // letter -> count of times this letter currently appears.
            // this can be thought as the haveMap, this was one of my 
            // main problems, i was thinking the window as the l, r pointers
            // but not the map that actually determines the conditions met on that window.
            var window = new Dictionary<char, int>();

            // letter -> count of times this letter should appear.
            var needMap = new Dictionary<char, int>();

            // Fill the need and have map.
            foreach (char c in t)
            {
                if (!needMap.ContainsKey(c))
                {
                    needMap.Add(c, 1);
                }
                else
                {
                    needMap[c]++;
                }
            }

            // Count of conditions that are currently being met.
            int have = 0;
            // Count of conditions that should be met.
            int need = needMap.Count;

            int l = 0;
            int length = int.MaxValue;
            int resultL = -1;
            int resultR = -1;
            for (int r = 0; r < s.Length; r++)
            {
                char c = s[r];

                if (!window.ContainsKey(c))
                {
                    window.Add(c, 1);
                }
                else
                {
                    window[c]++;
                }

                // If c not in needMap, then second condition won't execute
                // keeping us safe from the exception.
                if (needMap.ContainsKey(c) && window[c] == needMap[c])
                {
                    have++;
                }

                // While "have" and "need" are equals keep poping characters from
                // the left.
                while (have == need)
                {
                    // Pop the left character from the window.
                    window[s[l]]--;

                    // Check if after removed the poped character
                    // we still meet all the "have" conditions.
                    if (needMap.ContainsKey(s[l]) && window[s[l]] < needMap[s[l]])
                    {
                        have--;
                    }
                    
                    if ((r - l + 1) < length)
                    {
                        length = (r - l + 1);
                        resultL = l;
                        resultR = r;
                    }

                    l++;
                }
            }

            // If found something.
            if (length != int.MaxValue)
            {
                return s.Substring(resultL, resultR - resultL + 1);
            }

            return String.Empty;
        }

