        static public string MinWindow(string s, string t)
        {
            if (s.Length < t.Length)
            {
                return String.Empty;
            }

            // map char -> count. in string.
            var tMap = new Dictionary<char, int>();
            // converts t into a map, so we can check on it in O(1) complexity
            // this is a tradeof where we change time for memory.
            for ( int j = 0; j < t.Length; j++ )
            {
                char letter = t[j];
                // skip repeated keys. C# returns exceptions.
                if (tMap.ContainsKey(letter))
                {
                    // Increments the number of times this letter appeared.
                    tMap[letter] = tMap[letter] + 1;
                }
                else
                {
                    // Initialize.
                    tMap.Add(letter, 1);
                }
            }

            int l = 0, r = 0;
            int lFinal = 0, rFinal = 0;
            // A window candidate is a window which we dont know if will
            // end up being actually a window, since we dont know yet if contains
            // all the letters in t.

            // The cost is the number of wrong letters on a given window.
            // This is the last optimum window cost.
            int lastWindowCandidateCost = -1, windowCandidateCost = 0;
            bool inWindowCandidate = false;
            var windowFoundLetters = new Dictionary<char, int>();
            // The letters that has been fully found,
            // letters included here are included in t (even the count).
            var finalFoundLetters = new Dictionary<char, int>();
            bool windowsFound = false;
            int i = 0;
            while (i < s.Length)
            {
                char letter = s[i];

                // Detects were to start the window.
                // The window starts when we found a letter that is in t.

                // Does the current s' letter is in the t string.
                if (tMap.ContainsKey(letter))
                {
                    // Save the found letter in the window if is a new
                    // letter.
                    if (!windowFoundLetters.ContainsKey(letter))
                    {
                        windowFoundLetters.Add(letter, 1);
                    }
                    else
                    {
                        // How many times has been found on current window.
                        windowFoundLetters[letter] = windowFoundLetters[letter] + 1;
                    }

                    // Check letter count on both maps are equals.
                    if (windowFoundLetters[letter] == tMap[letter])
                    {
                        if (!finalFoundLetters.ContainsKey(letter))
                        {
                            finalFoundLetters.Add(letter, 1);
                        }
                    }
                    else if (windowFoundLetters[letter] > tMap[letter])
                    {
                        windowCandidateCost++;
                    }

                    if (windowFoundLetters.Count == 1 && !inWindowCandidate)
                    {
                        // If no letters has been found yet on current
                        // window candidate, then save the start of a new
                        // window candidate.
                        l = i;
                        inWindowCandidate = true;
                    }

                    // Not an else if, since if string only has one letter
                    // then it won't be able to get the (r)ight pointer.
                    if (finalFoundLetters.Count == tMap.Count)
                    {
                        if (inWindowCandidate)
                        {
                            // If we already, found all the t letters on current window.
                            r = i;
                            inWindowCandidate = false;

                            // Create a new dictionary for the next window candidate.
                            windowFoundLetters = new Dictionary<char, int>();
                            finalFoundLetters = new Dictionary<char, int>();

                            // Dont update final pointers if cost of last window candidate
                            // was smaller.
                            // Update if last window candidate cost has not been initialized yet.
                            if (lastWindowCandidateCost > windowCandidateCost || lastWindowCandidateCost == -1)
                            {
                                lFinal = l;
                                rFinal = r;
                                windowsFound = true;

                                // Update last window candidate cost.
                                // updated only if we found an more optimum cost.
                                lastWindowCandidateCost = windowCandidateCost;
                            }
                            
                            // Reset this for next candidates.
                            windowCandidateCost = 0;

                            // Start again from the last window found left index
                            // plus 1, to ensure overlaped windows get detected.
                            i = l + 1;
                            continue;
                        }
                    }
                }
                else
                {
                    // If current letter is not on t, and we are currently
                    // on a window candidate, then, increase the cost of current
                    // candidate.
                    if (inWindowCandidate)
                    {
                        windowCandidateCost++;
                    }
                }

                // This is not going to be a better window,
                // just start looking for the next candidate window.
                if (windowCandidateCost > lastWindowCandidateCost && lastWindowCandidateCost != -1)
                {
                    inWindowCandidate = false;

                    // Create a new dictionary for the next window candidate.
                    windowFoundLetters = new Dictionary<char, int>();
                    finalFoundLetters = new Dictionary<char, int>();

                    // Reset this for next candidates.
                    windowCandidateCost = 0;

                    // Start again from the last window found left index
                    // plus 1, to ensure overlaped windows get detected.
                    i = l + 1;
                    continue;
                }

                i++;
            }

            if (windowsFound)
            {
                int length = rFinal - lFinal + 1;
                return s.Substring(lFinal, length);
            }

            return String.Empty;
        }
